import React from "react";
import styled from "styled-components";
import ImageBox from "./imageSliderContents/ImageBox";
import TextBox from "./imageSliderContents/TextBox";

const ImageSliderContainer = styled.section`
  height: 60vh;
  width: 100vw;
  position: relative;
  /* overflow: hidden; */
  display: flex;

  img {
    width: 100%;
  }

  /* 임시 */
  overflow: scroll;
`;

const ImageSlider = () => {
  return (
    <ImageSliderContainer>
      <ImageBox />
      <TextBox />
    </ImageSliderContainer>
  );
};

export default ImageSlider;
